import React from "react";

import "./styles.css";

const FilterInput = ({ placeholder, label, type }) => {
  return (
    <div className="form__group">
      <input type={type} className="form__field" placeholder={placeholder} />
      <label className="form__label">{label}</label>
    </div>
  );
};

export default FilterInput;
